package utils

import (
	"context"
	"github.com/go-pay/gopay/apple"
	"testing"
)

func TestAppleVerifyReceipt(t *testing.T) {

	receipt, err := apple.VerifyReceipt(context.Background(), apple.UrlSandbox, "f28401658b1b4c1eb1822645b0f8b56e", "")
	if err != nil {
		t.Errorf("[ApplePay] VerifyReceipt err: %v", err)
	}
	t.Log(receipt)
}
